        <h1>Tienda BTM Ciclimsmo de Montaña</h1>
        <p>Mi nombre es:{nombre}</p>
        <p>quiero hacer:{caso}</p>

        <button>Servicio{e => cambiarArticulo("reparacion")} </button>

    </div>
}

